import React from 'react';
import axios from 'axios';

export default class SystemList extends React.Component {
  ish;
  res =[];
  componentDidMount() {
    axios.get(`https://new.vyatsu.ru/sveden/common`)
        .then(res => {
            const tp = res.data;
            this.ish = tp;
            console.log(this.ish);
        })
        
       
        
  }
  
  render() {
    return (
      <section>
      this.ish
      </section>
    )
  }
}
